INSERT INTO `casestudies` (`id`, `title`, `client`, `challenge`, `overview`, `benefits`, `url`, `img`, `created_at`, `updated_at`) VALUES
(1, 'Replace Navis Express Billing solution with CTS TOS Billing Module', 'APM Terminals, Algeciras, Spain', 'Study knowhow / behavior of Express and IFS database designed for customer tariff and replace through mapping CTS TOS billing solution', '<p>Studied the database structure of Navis and IFS application, analyzed the tariff\r\nstructure to be inbuilt, suggested the appropriate means to bill for events.\r\nApplication module is designed using ASP.Net technology over Oracle 11g;\r\nNow having rolled out for Navis Express, the commitment has been made to\r\nupgrade same to integrate with Navis N4 on rollout which is likely in next two\r\nmonths.<br></p>', 'Improper billing against activities performed has been rectified and facility to address billing for activities performed but not captured in Express or N4 is resolved', 'cts-tos-billing-module', 'case-study/99fe7d974ef489a37a5f0b960f459e75.png', '2022-03-23 23:13:09', '2022-04-01 01:40:30'),
(2, 'Enterprise Application for Transportation Operations – Road / Rail / Sea', 'Adani Logistics, India', 'Consolidate business operations of CFS / ICDs, Rake Operations and Fleet Operations; Automate processes to minimize manpower', '<p>Designed the application using ASP.Net technology over Oracle 11g; built\r\ninterface with third party tools – SAP, Navis Express and Automation\r\napplication tool. The solution manages operation of four ICDs, Rake\r\nmovements, Rake Planning, Yard Planning, Warehouse Planning, Fleet\r\nPlanning and allocation, KPIs, Dashboards<br></p>', 'Decision making tool supporting information gathering from various container terminals to assist in common method of analyzing performance', 'transportation-operations', 'case-study/6a01678a2bf6a466dd3529fd3d3910c0.png', '2022-03-23 23:20:11', '2022-04-01 01:40:57'),
(3, 'Solution for Multi Model Business Operations of CFSs / ICDs', 'APM Terminals, India', 'Replace existing application software designed to independently manage operations of various CFS’s and ICD’s with centralized solution', '<p>Design and development of distributed application using Microsoft\r\ntechnologies. Used OO design techniques and implemented in ASP.Net.\r\nThe product could be deployed over Touch screens at Kiosks for\r\ncustomers and Hand Held Terminals for Real Time data capture.\r\nImplemented the business logic desired to analyze performance of\r\nmultiple locations operating with multiple business modalities through\r\ncommon platform..<br></p>', 'Reduced TCO (Total Cost of Ownership); improved Truck Turn Around time and effective resource management; delivered crucial MIS reports.', 'multi-modal-business-operations', 'case-study/29fd9126a97f629de13a4eeff6b89125.png', '2022-03-23 23:21:29', '2022-04-01 01:41:19'),
(4, 'BI / DWH Tool to analyze Performance of Terminals across Globe', 'Dubai Ports World, Dubai', 'Build solution to analyze performance of business across various container terminals over a common measurable parameter', '<p>Architect methodology to assess the performance of\r\nbusiness through various parameters; Designed program\r\nto capture data from existing sources in the desired format;\r\nDeveloped web based application using OO techniques and\r\nimplemented in ASP.Net over Oracle 10G platform;\r\nIncorporated What-If scenarios to support decision making\r\nover improvisation of business across various modalities; Deployed and\r\ntrained users across 49 container terminals spread all across the globe.&nbsp;<br></p>', 'Decision making tool supporting information gathering from various container terminals to assist in common method of analyzing performance', 'bi-dwh-tool', 'case-study/6fd94addd1aee53988dd102cecbb1790.png', '2022-03-23 23:23:39', '2022-04-01 01:41:30'),
(5, 'Ro/Ro Terminal Operations Software', 'MPSEZ, Mundra (Adani Group)', 'Implement RO-RO-TOS application software on Real Time Operational environment interfaced with SAP Financial module', '<p><font face=\"Times New Roman, serif\"><span style=\"font-size: 14.6667px;\">Design and development of distributed application using .Net technologies. Used OO design techniques and implemented in ASP.Net on Oracle Platform. Application also supports use of HHTs for real time operational environment.</span></font><br></p>', 'The product has reduced the time per transaction from 5 minutes to less than few seconds, on the wharf and yard through RDT.', 'ro-ro-terminal-operations-software', 'case-study/0236280951b521d146671223db8b28fa.png', '2022-04-08 04:04:50', '2022-04-08 04:11:35'),
(6, 'Terminal Operating System for Container Terminal', 'ICTPL, Mumbai (Gammon India & Dragados SPL, Spain)', 'Provide IT solution covering all mandatory needs for managing a container terminal with minimal cost', '<p>Customized Container Terminal Suite product designed using Developer 2000 (Forms 2.0 and Reports 3.0) on Oracle platform. Reengineered the product to cover only mandatory process flow along with billing structure and implemented on Client / Server environment.<br></p>', 'The reengineered product has been implemented within 45 days has been very cost effective.', 'terminal-operating-system-for-container-terminal', 'case-study/77deb6a99895f72eabcc1896081dd004.png', '2022-04-08 04:07:42', '2022-04-08 04:10:00'),
(7, 'Reengineering of Point of Sale (PoS) software product', 'Based in North Carolina, USA', 'Understand the existing design and source code, to reengineer the product while implementing enhancements with a commitment to increase the reusability', '<p>Design and development of distributed application using Microsoft technologies. Used OO design techniques and implemented in VB, which enabled the reuse of framework so that product could be deployed over Touch screens at Kiosks. Implemented the business logic to process credit card transactions.<br></p>', 'The reengineered product has reduced the time per transaction from 5 minutes to less than a minute, at point of sale.', 'point-of-sale', 'case-study/efd254dda3952b52125c8b76b9689911.png', '2022-04-08 04:08:46', '2022-04-08 04:08:46');

