INSERT INTO `news` (`id`, `title`, `img`, `decrip`, `tag`, `url`, `created_at`, `updated_at`) VALUES
(2, 'RAVINDRA NYAMATI JOINS VNVCS AS COO', 'news/22af9ee1392fc15673bbbcce9182d41b.png', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; line-height: 1.8em; color: rgb(117, 117, 117); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><b>After a phenomenal sail of many years of building a legacy of its own, VnVCS is elated to announce that Mr Ravindra Nyamati, who houses a solid 25+ years of experience in various esteemed organization like - Adani Groups, DP World and APMT is joining us at VnVCS as Chief Operating Officer (COO). We are thrilled to have him on board with us.</b></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; line-height: 1.8em; color: rgb(117, 117, 117); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><b><br></b>We are a cut above the rest when it comes to offering IT solutions for Ports, Shipping and Logistics sector. Our exceptional team of IT professionals go the extra mile to develop software products and deliver unmatched services. With his capabilities in shipping and ports which are remarkable and would definitely take VnVCS to even greater heights</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; line-height: 1.8em; color: rgb(117, 117, 117); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">The team at VnVCS congratulates Mr Ravindra Nyamati and looks forward to setting a new benchmarks.</p>', 'DP World', '2021', '2022-03-11 00:47:44', '2022-03-11 00:47:44');

